pt 1pt medium; border-style: solid solid solid none; border-color: black black black -moz-use-text-color; padding: 0in 5.4pt; height: 14.35pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><i><span style="font-size: 10pt;">2</span></i></p></td></tr><tr style="height: 8.95pt;"><td width="65" valign="top" style="width: 48.6pt; border-width: medium 1pt 1pt; border-style: none solid solid; border-color: -moz-use-text-color black black; padding: 0in 5.4pt; height: 8.95pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><b><span style="font-size: 10pt;">Node </span></b></p></td><td width="23" valign="top" style="width: 16.9pt; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; height: 8.95pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><span style="font-size: 10pt;">a</span></p></td><td width="30" valign="top" style="width: 22.5pt; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; height: 8.95pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><span style="font-size: 10pt;">c</span></p></td><td width="24" valign="top" style="width: 0.25in; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; height: 8.95pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><span style="font-size: 10pt;">d</span></p></td></tr></tbody></table></div><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify;"><span style="font-size: 12pt; line-height: 115%;">If user wants to enter b at location 1, the linked list will be modified as follows:</span></p><div align="center"><table cellspacing="0" cellpadding="0" border="1" class="MsoNormalTa