 class="MsoNormal" style="text-align: justify; line-height: normal;"><b><span style="font-size: 10pt;">Node </span></b></p></td><td width="21" valign="top" style="width: 15.8pt; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; height: 14.35pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><span style="font-size: 10pt;">a</span></p></td><td width="30" valign="top" style="width: 22.5pt; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; height: 14.35pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><span style="font-size: 10pt;">b</span></p></td><td width="24" valign="top" style="width: 0.25in; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; height: 14.35pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><span style="font-size: 10pt;">c</span></p></td><td width="29" valign="top" style="width: 21.7pt; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color black black -moz-use-text-color; padding: 0in 5.4pt; height: 14.35pt;"><p class="MsoNormal" style="text-align: justify; line-height: normal;"><span style="font-size: 10pt;">d</span></p></td></tr></tbody></table></div><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">Delete:</span></b><span style="font-size: 12pt; line-height: 115%;"> Deletes a node from the linked list. The node to be deleted can be first, last or any node. This function will delete only the first occurrence of the character to be deleted.</span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">DeleteAllOccurrences: </span></b><span style="font-size: 12pt; line-height: 115%;">Deletes all occurrences of a character to be deleted. <span></span></span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">DeleteFirstNode:</span></b><span style="font-size: 12pt; line-height: 115%;"> Deletes first node from the linked list. </span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">DeleteLastNode:</span></b><span style="font-size: 12pt; line-height: 115%;"> Deletes last node from the linked list.</span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">IsEmpty</span></b><span style="font-size: 12pt; line-height: 115%;">: Returns true if linked list is empty.</span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">ListSize</span></b><span style="font-size: 12pt; line-height: 115%;">: Returns total number of nodes present in the linked list.</span><span style="font-size: 12pt; line-height: 115%;"></span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">DisplayList</span></b><span style="font-size: 12pt; line-height: 115%;">:<b></b>Displays all nodes present in the linked list.</span><span style="font-size: 12pt; line-height: 115%;"></span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">Find: </span></b><span style="font-size: 12pt; line-height: 115%;">Search linked list for the node specified by user.</span></p><p class="MsoNormal" style="margin-left: 0.5in; text-align: justify; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 115%;">ClearList</span></b><span style="font-size: 12pt; line-height: 115%;">: Empties linked list (deletes all nodes).</span></p><p class="MsoNormal" style="margin: 0in 0in 0.0001pt 0.5in; text-align: justify; text-indent: -0.25in; line-height: 150%;"><span style="font-size: 12pt; line-height: 150%;"><span>•<span></span></span></span><b><span style="font-size: 12pt; line-height: 150%;">Merge</span></b><span style="font-size: 12pt; line-height: 150%;">: Takes a string as an input from user, reads one character at a time and stores that character at the end of the existing linked list.</span><span style="font-size: 12pt; line-height: 150%;"></span></p> </p></div><div id="dates" class="box generalbox generalboxcontent boxaligncenter"><table><tr><td class="c0">Available from:</td>    <td class="c1">Thursday, 4 November 2010, 07:45 AM</td></tr><tr><td class="c0">Due date:</td>    <td class="c1">Wednesday,  24 November 2010, 11:55 PM</td></tr></table></div>
